前两天跟我公司两个年轻人（纯美国人）聊天，他们对当前美国的通货膨胀挺绝望的，他们父母那代人，蓝领的年薪已经4-5万美金，那会一套新房子，2000多尺的House也就10来万，夫妻俩工作轻轻松松可以买一套，带前后院；现在到了他们这代人，蓝领的年收入6-8万美金，同级别的房子已经涨到了50万以上，这还不是洛杉矶和纽约这种大城市；所以现在很多美国年轻人也还是和父母住在一起，看来当代年轻人的很多问题是全世界的问题，不分国界。
我最近发现很多房子是父母离世后儿女过来住了。问了一个人，女的快四十了说没房子一直住公寓，父亲跟继母离世后把房子给了她。房子本身四十万。
